style.css:
/* Roblox Theme - PRODXMARV */

/* Set the background color to black */
body {
    background-color: black !important;
}

/* Center the text horizontally and vertically */
body::before {
    content: "PRODXMARV";
    color: white;
    font-size: 24px;
    position: fixed;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    z-index: 9999;
}
